import React from 'react'

function FilterCard(props) {
  const { restarents } = props;
  return (
    <div className='p-4 card'>
      <div className="card-body">
        <img className='card-img float-left image-fluid rounded-25 shadow' src={restarents.image} alt="" />

      </div>
    </div>
  )
}

export default FilterCard
